import React from 'react'
import Todo from './Todo'

const ListToDo = ({todoList}) => {
    return (
        <div>
            {
                todoList.map((todo) =>(<Todo todo={todo}  key={todo.id} />))
            }
        </div>
    )
}

export default ListToDo
